var assert = require('assert');
var Client = require('../index.js');
var EC = require('@ties-network/db-sign');

async function sleep(tm) {
    return new Promise(resolve => setTimeout(resolve, tm));
}

describe('Ties Client Basic functions', function() {
    before(async function(){
        this.timeout(20000);
        Client.setConfig('test');
        await Client.connect();
        await mockupData();
    });

    describe('cryptography', function() {
        let user, mainUser;
        before(async function(){
            this.timeout(5000);
            mainUser = user = await Client.createUserFromPrivateKey('crunchy protozoan magazine punctured unicycle overrate antacid jokester salami platypus fracture mute');

            // await Client.BC.listenTransfer(mainUser.wallet.address, (balance, address, balanceOld) => {
            //     console.log('Transfer received: ', balance, address, balanceOld);
            // });
            // await Client.BC.listenBalance(mainUser.wallet.address, (balance, addr, balanceOld) => {
            //     console.log("Balance changed: ", balance, addr, balanceOld);
            // });

            user.wallet.setPassword('123456');
            Client.confirmCallback = async function(description) {
                console.log("Confirming transaction: " + description);
                //await sleep(5000);
                console.log("User confirmed with password: 123456");
                return "123456";
            }
        });

        it('should user restore from phrase', async function() {
            assert.ok(user.wallet.address == '0x00dbD017A900258A242599624781f7423969c671'.toLowerCase());
        });

        it('can check user balance', async function() {
            let val = await user.getTieBalance();
            assert.ok(val.gt(0));
        });

        it('can check user deposit', async function() {
            this.timeout(60000); //Waiting a minute for a transaction confirmation
            let prevval = await user.getTieDeposit();
            await user.register();
            let val = await user.getTieDeposit();
            assert.ok(val.gt(prevval));
        });

        it('should delete user', async function() {
            await user.deleteFromDB();
            let _user = await Client.User.createFromDB(user.wallet.address);
            assert.ok(!_user.isLoaded());
        });

        it('should create user', async function() {
            user.user = {
                __address: user.wallet.address,
                name: 'Vassiliy',
                surname: 'Pupkin',
                company: 'CSI',
                position: 'Detective',
                country: 'USA',
                description: "Decent minded individual",
                keywords: ['blockchain', 'network', 'murder', 'investigation', 'crime', 'data mining', 'database']
            };
            await user.saveToDB();
            let _user = await Client.User.createFromDB(user.wallet.address);
            assert.ok(_user.isLoaded() && _user.user.name == 'Vassiliy');
        });

        it('should manipulate projects', async function() {
            let proj = user.newProject({
                name: 'Ties.Network',
                date_start: '2017-05-15',
                date_end: null,
                description: 'A new business platform for cryptocommunity including unique decentralized database'
            });

            await proj.saveToDB();

            let projects = await user.getProjects();
            assert.ok(projects.length >= 1, 'Vassiliy should have at least one project');

            await proj.deleteFromDB();
            delete(user.projects); //Remove projects cash

            proj = await Client.Project.createFromDB(proj.raw.__address, proj.raw.id);
            assert.ok(proj == null, 'The project should have been deleted')
        });

        it('should search user', async function() {
            this.timeout(5000);
            await sleep(2000); //Give elasticsearch the time to update indexes

            let users = await Client.User.search('game');
            assert.equal(users.length, 2, 'There should be 2 users interested in games');

            users = await Client.User.search('dmitry kochin');
            assert.equal(users[0] && (users[0].user.name + ' ' + users[0].user.surname), 'Dmitry Kochin');
        });

        let invite1, invite2;
        it('should issue invitations', async function() {
            this.timeout(60000);
            let user = Client.user;

            let lastInvite = await user.invitationGetLast();
            lastInvite = lastInvite ? EC.decodeInvitation(lastInvite).index : 0;

            //Withdraw latest invitations
            // for(let i=40; i<=lastInvite; ++i){
            //     try {
            //         let code = EC.encodeInvitation(i, user.wallet.secret);
            //         let status = await user.invitationRedeem(code);
            //         console.log('Withdrawn invitation ' + i + ': ' + status);
            //     }catch(e){
            //         console.log('Error Withdrawing invitation ' + i + ': ' + e.message);
            //     }
            // }

            invite1 = await Client.user.invitationCreate();
            invite2 = await Client.user.invitationCreate();

            let last = EC.decodeInvitation(invite2).index;

            assert.equal(last, lastInvite + 2, 'There should be 2 invitations more issued by this user');
        });

        it('should redeem invitations (sponsored)', async function() {
            this.timeout(60000);
            let user = await Client.createUserFromPrivateKey("April crunchy protozoan magazine punctured unicycle overrate antacid jokester salami platypus fracture mute");
            user.wallet.setPassword('123456');

            //Ensure user has zero balance
            let gp = await Client.BC.web3.eth.getGasPricePromise();
            let balanceOld = await user.getNativeBalance();

            if(!balanceOld.eq(0)){
                await Client.makeTransactions(async() => {
                    await Client.BC.web3.eth.sendTransactionPromise({
                        from: user.wallet.address,
                        to: mainUser.wallet.address,
                        value: balanceOld.sub(gp.mul(21000)),
                        gas: 21000,
                        gasPrice: gp
                    });
                }, "Returning ether to main account");

                let old = balanceOld;
                while(true){
                    balanceOld = await user.getNativeBalance();
                    if(!balanceOld.eq(old))
                        break;
                    await sleep(500);
                }
            }

            assert.ok(balanceOld.eq(0), 'User should have zero ether balance!');
            let tokensOld = await user.getTieBalance();

            await user.invitationRedeem(invite1);

            let balance = await user.getNativeBalance();
            let tokens = await user.getTieBalance();

            assert.ok(balance.eq(balanceOld.add(Client.BC.web3.toWei(0.2, 'ether'))), "Ether balance should have increased");
            assert.ok(tokens.eq(tokensOld.add(Client.BC.web3.toWei(10, 'ether'))), "TIE balance should have increased");
        });

        it('should withdraw invitation', async function() {
            this.timeout(60000);
            let user = Client.setUser(mainUser);

            let balanceOld = await user.getNativeBalance();
            let tokensOld = await user.getTieBalance();

            await user.invitationRedeem(invite2);

            let balance = await user.getNativeBalance();
            let tokens = await user.getTieBalance();

            assert.ok(balance.gt(balanceOld) && balance.lt(balanceOld.add(Client.BC.web3.toWei(0.2, 'ether'))), "Ether balance should have increased less than by 0.2");
            assert.ok(tokens.eq(tokensOld.add(Client.BC.web3.toWei(10, 'ether'))), "TIE balance should have increased");
        });

        it('should transfer', async function() {
            this.timeout(20000);
            let user_to = await Client.createUserFromPrivateKey("April crunchy protozoan magazine punctured unicycle overrate antacid jokester salami platypus fracture mute");
            let user = Client.setUser(mainUser);

            let tokensOld = await user.getTieBalance();

            let tx = await user.transfer(user_to.wallet.address, 10);
            assert.equal(tx.length, 1, 'transfer should be a single transaction');
            assert.ok(tx[0].tx, 'transfer should have returned transaction info');

            let tokens = await user.getTieBalance();

            assert.ok(tokens.eq(tokensOld.sub(10)), "TIE balance should have decreased");
        });

        it('should manipulate invoices', async function() {
            let user_to = await Client.createUserFromPrivateKey("April crunchy protozoan magazine punctured unicycle overrate antacid jokester salami platypus fracture mute");
            Client.setUser(user);

            let invoice = Client.Invoice.createNew({
                comment: 'Pay for the air',
                currency: 'TIE',
                amount: Client.BC.web3.toWei(0.01, 'ether').toString(),
                recepient: user_to.wallet.address
            });

            await invoice.saveToDB();

            let invoices = await Client.Invoice.getIncoming(user_to.wallet.address);
            assert.ok(invoices.length >= 1, 'April should have at least one incoming invoice');

            invoice = invoices[0];
            Client.setUser(user_to);

            invoice.setPaid();
            await invoice.saveToDB();

            invoices = await Client.Invoice.getOutgoing(user.wallet.address);
            assert.ok(invoices.length >= 1, 'Vassiliy should have at least one outgoing invoice');
            assert.ok(invoices[0].getPaid(), 'The invoice should have been paid by April');

//            //Clean up invoices
            let json = invoices[0].toJson();
            await Client.saveObject('ties_invoice_status', {__address: json.status.__address, id: json.status.id}, true);
            Client.setUser(user);
            await Client.saveObject('ties_invoice', {__address: json.invoice.__address, id: json.invoice.id}, true);

        });

    });
});

